    /**
     * 往后读取数据，并记录负数和0出现的个数。若出现0，则以0为分割符重新计数，
     * 若负数出现偶数个则max和当前索引减去开始读取的第一个数索引比较，若负数出现奇数个则max与索引减去从第一个负数后一个索引比较
     *
     * @param nums
     * @return
     */
    public int getMaxLen0(int[] nums) {
        int max = 0, neg = 0, neg1Index = 0, lastIndex = -1;
        for (int i = 0, len = nums.length; i < len; i++) {
            int cur = nums[i];
            // 记录负数的个数
            if (cur < 0) {
                neg++;
                if (neg == 1) {
                    neg1Index = i;
                    continue;
                }
            }
            // 以0为分割符
            else if (cur == 0) {
                neg = neg1Index = 0;
                lastIndex = i;
            }
            // 偶数个负数则max和当前索引减去初始索引
            if (neg % 2 == 0) {
                max = Math.max(max, i - lastIndex);
            }
            // 奇数个负数则max与索引减去从第一个负数索引
            else {
                max = Math.max(max, i - neg1Index);
            }
        }
        return max;
    }

    public int getMaxLen1(int[] nums) {
        int ans = 0;
        int pos = 0, neg = 0;
        for (int num : nums) {
            if (num == 0) {
                pos = neg = 0;
            } else if (num > 0) {
                ++pos;
                if (neg > 0) {
                    ++neg;
                }
            } else {
                int newpos = (neg > 0 ? neg + 1 : 0);
                int newneg = (pos > 0 ? pos + 1 : 1);
                pos = newpos;
                neg = newneg;
            }
            ans = Math.max(ans, pos);
        }
        return ans;
    }

    public int getMaxLen2(int[] nums) {
        int n = nums.length;
        int[][] dp = new int[n + 1][2];
        int inf = (int) 1e8;

        for (int i = 0; i <= n; i++) {
            for (int j = 0; j < 2; j++) {
                dp[i][j] = -inf;
            }
        }
        dp[0][0] = 0;
        dp[0][1] = -inf;
        int ans = 0;

        for (int i = 0; i < n; i++) {
            if (nums[i] == 0) {
                dp[i + 1][0] = 0;
                dp[i + 1][1] = -inf;
                continue;
            }
            if (nums[i] > 0) {
                for (int j = 0; j < 2; j++) {
                    dp[i + 1][j] = Math.max(dp[i + 1][j], dp[i][j] + 1);
                }
            } else {
                for (int j = 0; j < 2; j++) {
                    dp[i + 1][j] = Math.max(dp[i + 1][j], dp[i][j ^ 1] + 1);
                }
            }
            dp[i + 1][0] = Math.max(0, dp[i + 1][0]);
            ans = Math.max(ans, dp[i + 1][0]);
        }
        System.out.println(Arrays.deepToString(dp));
        return ans;
    }


    /**
     * 偶数个负数所占的最长区间
     *
     * @param nums
     * @return
     */
    public int getMaxLen(int[] nums) {
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] > 0) {
                nums[i] = 1;
            } else if (nums[i] < 0) {
                nums[i] = -1;
            }
        }
        for (int i = nums.length; i >= 0; i--) {
            if (check(nums, i)) {
                return i;
            }
        }
        return 0;
    }

    boolean check(int[] nums, int len) {
        int mul = 1, numsLen = nums.length;
        for (int i = 0; i <= numsLen - len; i++) {
            for (int j = i; j < len + i; j++) {
                mul *= nums[j];
            }
            if (mul > 0) {
                return true;
            }
            mul = 1;
        }
        return false;
    }
